import axios from 'axios'

/*
* 发送请求获取成绩数据*/
export default function request(studentID, studentPassword){
  axios({
    method: 'post',
    datatype: 'jsonp',
    url: 'http://localhost:1323/test',
    data: {
      Sid: studentID,
      Pwd: studentPassword,
    }
  }).then(function (response) {
        return({
          studentDataResult: response,
        });
      })
      .catch(function (error) {
        console.log(error);
      });
};
